import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/js/login';
import SignUpOne from './components/js/signUpOne';
import SignUpTwo from './components/js/signUpTwo';
import Productivity from './components/js/productivity';
import SchedulePage from './components/js/schedulePage';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={<Login/>} />
        {/* <Route path="/signupone" component={SignUpOne} /> */}
        <Route path="/signuptwo" component={SignUpTwo} />
        <Route path="/productivity" component={Productivity} />
        <Route path="/schedulepage" component={SchedulePage} />
      </Switch>
    </Router>
  );
}

export default App;
